import React from "react";

//Calendar item
class CalendarItem extends React.Component{
    constructor(props){
        super(props);
        this.state ={
            subject:'',text:'',time:'',date:'',id:''
        };
    }
render(){
    return(
        <div className="col">
            <div >
            <label >Subject:
                <div>
            <input value={this.state.subject} type="text" id="NewItemSubject"></input>         
            </div>
            </label>
            
            </div>
            <div>
            <textarea value={this.state.text} rows="5" id="NewItemText"></textarea>
            </div>
            <div>
            <label htmlFor="NewItemTime">Time:
            <div><input value={this.state.time} type="time" id ="NewItemTime"></input></div></label>
            </div>
            <div>
            <label htmlFor="NewItemDate">Date:
            <div>
            <input value={this.state.date} type="date" id ="NewItemDate"></input></div>
            </label>
            
            </div>
        </div>
    )
}

}
export default CalendarItem;
